import React, { useEffect, useState } from "react";
import Card from "../UI/Card/Card";
import axios from 'axios';
const Displaytweets=()=>{
    const [tweetList,setTweetList]=useState([{}]);
    const displayTweetHandler=async(e)=>{
        //e.preventDefault();

        try{
            const response=await axios.get(`http://localhost:8081/all`);
            const listtweet=response.data;
            console.log(listtweet);
            setTweetList(listtweet);
            
        }catch(e){console.log(e)}
        console.log(tweetList)
    }

    useEffect(()=>{
        displayTweetHandler();
        console.log(tweetList);
        
    },[]);

    return(
        <>
            <Card>
                
                <ul>
                {tweetList.map(tweets=>{
                    <li key="{index}">
                        {tweets.title}
                    </li>
                })}
                   
                </ul>
            </Card>
        
        </>
    )

}

export default Displaytweets;
